import React, { Component } from 'react';
import ContentContainer from '../../hoc/ContentContainer/ContentContainer';
import SectionTitle from '../SectionTitle/SectionTitle';
import SliderTemplates from'../Widgets/Slider_templates';
import data from '../../db';
import './agentsection.scss';


class AgentSection extends Component {


render(){
  const agents = data.agents;
  const featuredAgents = agents.filter((agent)=>{
    return agent.featured == true
  })
  console.log(featuredAgents, "these are the agents")
  return(
    <section className = "agent-section">
      <ContentContainer>
        <SectionTitle> Choose The Perfect Agent For Your Needs </SectionTitle>
        <SliderTemplates template = "4-column"> </SliderTemplates>
      </ContentContainer>
    </section>
  )
}

}

export default AgentSection;
